    {
        if (product.ProductId > 0)
        {
            listUnit = purchaseRepository.GetProducttounit(product.ProductId);
            listBatch = purchaseRepository.GetProducttoBatch(product.ProductId);
        }
        else
        {
            product.UnitId = 0;
            product.BatchId = 0;
        }

        this.StateHasChanged();
    }
    public void SaveProduct()
    {
        string strManu = DreamerDateConveter.convertToBS(DateTime.Now);
        string strExp = DreamerDateConveter.convertToBS(DateTime.Now);
        if (strAdd == true)
        {
            if (product.ProductId == 0)
            {
                Snackbar.Add("Choose Product.", Severity.Info);
            }
            else if (product.UnitId == 0)
            {
                Snackbar.Add("Choose Unit.", Severity.Info);
            }
            else if (product.BatchId == 0)
            {
                Snackbar.Add("Choose Batch.", Severity.Info);
            }
            else if (product.Qty == 0)
            {
                Snackbar.Add("Enter Qty", Severity.Info);
            }
            else
            {
                SqlConnection sqlcon = new SqlConnection(_conn.DbConn);
                sqlcon.Open();
                SqlTransaction sql = sqlcon.BeginTransaction();


